import { useState } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import styles from "./styles.module.css";
import crear from "../../assets/img/cuenta.png";
import {AiOutlineEye, AiOutlineEyeInvisible} from "react-icons/ai";


const Signup = () => {
	const [state, setState] = useState({
		username: "",
		password: "",
		email: "",
	  });

	  const userData = {
		username: state.username,
		password: state.password,
		email: state.email,
		authen:false,
	  };

	  const handleChange = (e) => {
		const value = e.target.value;
		setState({
		  ...state,
		  [e.target.name]: value,
		});
	  };

	  const handleSubmit = (e) => {
		e.preventDefault();

		axios
		  .post("http://localhost:3000/api/user/create", {
			username: userData.username,
			correo: userData.email,
			pass: userData.password,
			authen: userData.authen,
		  })
		  .then((response) => {
			console.log(response.status, "llegamos bien");
			Swal.fire({
			  position: "top-end",
			  icon: "success",
			  title: "Registro exitoso",
			  showConfirmButton: false,
			  timer: 1000,
			});

			axios
			  .post("http://localhost:3000/api/user/valid", {
				email: userData.email,
			  })
			  .then((response) => {
				console.log("confirmacion enviada");
				console.log("response");
			  })
			  .catch((error) => {
				if (!error.response) {
				  console.log(error);
				  console.log("server respondio");
				} else if (error.request) {
				  console.log("error");
				  console.log(error);
				  console.log(userData, "userdata");
				} else {
				  console.log(error);
				}
			  });
		  })
		  .catch((error) => {
			if (!error.response) {
			  console.log(error.response);
			  console.log("server respondio");
			} else if (error.request) {
			  console.log("error");
			  console.log(error);
			  console.log(userData);
			} else {
			  console.log(error);
			}
		  });


	};


	return (
		<div className={styles.signup_container}>
			<div className={styles.signup_form_container}>
				<div className={styles.left}>


					<Link to="/login">
						<button type="button" className={styles.white_btn}>
							Return
						</button>
					</Link>
				</div>
				<div className={styles.right}>
					<form className={styles.form_container} onSubmit={handleSubmit}>
						<h1>Create Account</h1>
						<img src={crear} width="200px" alt="User Icon"/>
						<input
							type="text"
							placeholder="Name"
							name="name"
							onChange={handleChange}
							value={data.name}
							required
							className={styles.input}
						/>
						<input
							type="email"
							placeholder="Email"
							name="email"
							onChange={handleChange}
							value={data.email}
							required
							className={styles.input}
						/>
						<div className={styles.password}>
						<input
							type={state ? "text": "password" }
							placeholder="Password"
							name="password"
							onChange={handleChange}
							value={data.password}
							required
							className={styles.input}
						/> 	
							<button type="button"  className={styles.btn} onClick={toggleBtn}>
								{
									state ? <AiOutlineEyeInvisible/> : 
									<AiOutlineEye/>
								}
							</button>




						</div>


						{error && <div className={styles.error_msg}>{error}</div>}
						<button type="submit" className={styles.green_btn}>
							Sing Up
						</button>

					</form>
				</div>
			</div>
		</div>
	);
};

export default Signup;
